   udalosti.forEach((udalost)=>{
       $("#udalosti tbody").append(`<tr>
           <td>
             <p class="udalost-name"><i class="fas fa-chevron-down"></i><a>${udalost.udalost}</a></p>
             <p class="udalost-detaily">${udalost.detaily}</p>
           </td>            
       </tr>`);
   });

   $(".udalost-detaily").hide();

   $(".udalost-name i, .udalost-name a").on("click", function(){
       $(".udalost-detaily").hide();
       $(this).parent().next().show(500);
   });    
   $(".udalost-name i, .udalost-name a").on("mouseover", function(){
      $("#udalosti tr").removeClass("bg-secondary text-white");
      $(this).parents("tr").addClass("bg-secondary text-white");
  });  
///////////////////////////////////////////////////////////////////////////////////////
